import React from 'react';
import { Link, animateScroll as scroll } from 'react-scroll';
import styles from './Navbar.module.css';

const scrollToTop = () => {
    scroll.scrollToTop();
};

const navbar = (props) => {
    const theme = props.theme;
    return (
        <nav className={styles.nav} id='navbar'>
            <div className={styles.navContent}>
                <h3 
                    onClick={scrollToTop}
                    className={styles.navLogo} >RT</h3>
                <ul className={styles.navItems}>
                    <li className={styles.navItem}>
                        <Link
                            activeClass={styles.active}
                            to='section1'
                            spy={true}
                            smooth={true}
                            offset={-100}
                            duration={500}
                        >
                            Section 1
                        </Link>
                    </li>
                    <li className={styles.navItem}>
                        <Link
                            activeClass={styles.active}
                            to='section2'
                            spy={true}
                            smooth={true}
                            offset={-100}
                            duration={500}
                        >
                            Section 2
                        </Link>
                    </li><li className={styles.navItem}>
                        <Link
                            activeClass={styles.active}
                            to='section3'
                            spy={true}
                            smooth={true}
                            offset={-100}
                            duration={500}
                        >
                            Section 3
                        </Link>
                    </li><li className={styles.navItem}>
                        <Link
                            activeClass={styles.active}
                            to='section4'
                            spy={true}
                            smooth={true}
                            offset={-100}
                            duration={500}
                        >
                            Section 4
                        </Link>
                    </li><li className={styles.navItem}>
                        <Link
                            activeClass={styles.active}
                            to='section5'
                            spy={true}
                            smooth={true}
                            offset={-100}
                            duration={500}
                        >
                            Section 5
                        </Link>
                    </li>
                </ul>
            </div>
        </nav>
    )
};

export default navbar;
